import React from 'react';
import Frame69 from './Frame69';

const Frame70 = () => {
  return (
    <div
      style={{
        width: '1033px',
        minHeight: '322px',
        display: 'flex',
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'flex-start',
      }}
    >
      <div
        style={{
          width: '366px',
          height: '76px',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '28px',
          lineHeight: '38px',
          letterSpacing: '-0.05em',
          textTransform: 'capitalize',
          color: '#1C264C',
          marginBottom: '16px',
        }}
      >
        A new way to move goods Tap. Track. Done.
      </div>
      <Frame69 />
    </div>
  );
};

export default Frame70;
